- fields:
    bfo_part_of_some: []
    label: axiom holds for all times
    obo_definition: "\n\n## Elucidation\n\nThis is used when the statement/axiom is\
      \ assumed to hold true 'eternally'\n\n## How to interpret (informal)\n\nFirst\
      \ the \"atemporal\" FOL is derived from the OWL using the standard\ninterpretation.\
      \ This axiom is temporalized by embedding the axiom\nwithin a for-all-times\
      \ quantified sentence. The t argument is added to\nall instantiation predicates\
      \ and predicates that use this relation.\n\n## Example\n\n    Class: nucleus\n\
      \    SubClassOf: part_of some cell\n\n    forall t :\n      forall n :\n   \
      \     instance_of(n,Nucleus,t)\n         implies\n        exists c :\n     \
      \     instance_of(c,Cell,t)\n          part_of(n,c,t)\n\n## Notes\n\nThis interpretation\
      \ is *not* the same as an at-all-times relation\n\n"
    rdfs_comment: None
    rdfs_is_class: false
    rdfs_subClassOf_ancestors: []
    uri: http://purl.obolibrary.org/obo/RO_0001901
  model: feed.muscleowl
  pk: 4851
- fields:
    bfo_part_of_some: []
    label: temporal interpretation
    obo_definition: An assertion that holds between an OWL Object Property and a temporal
      interpretation that elucidates how OWL Class Axioms that use this property are
      to be interpreted in a temporal context.
    rdfs_comment: None
    rdfs_is_class: false
    rdfs_subClassOf_ancestors: []
