    label: relation has no temporal argument
    obo_definition: "\n\n## Elucidation\n\nThis is used when the first-order logic\
      \ form of the relation is\nbinary, and takes no temporal argument.\n\n## Example:\n\
      \n    Class: limb\n    SubClassOf: develops_from some lateral-plate-mesoderm\n\
      \n     forall t, t2:\n      forall x :\n        instance_of(x,Limb,t)\n    \
      \     implies\n        exists y :\n          instance_of(y,LPM,t2)\n       \
      \   develops_from(x,y)\n\n\n"
    rdfs_comment: None
    rdfs_is_class: false
    rdfs_subClassOf_ancestors: []
    uri: http://purl.obolibrary.org/obo/RO_0001902
