      \n    Class: limb\n    SubClassOf: develops_from some lateral-plate-mesoderm\n\
      \n     forall t, t2:\n      forall x :\n        instance_of(x,Limb,t)\n    \
      \     implies\n        exists y :\n          instance_of(y,LPM,t2)\n       \
      \   develops_from(x,y)\n\n\n"
